// src/commands/all.ts
async function allCmd(prdPath, options) {
  console.log("\u{1F31F} Starting complete pipeline...");
  if (options.verbose) {
    console.log("Options:", options);
    console.log("PRD Path:", prdPath);
  }
  try {
    console.log("\n\u{1F4DD} Step 1: Compile");
    await compileCmd(prdPath, {
      project: options.project,
      workspace: options.workspace,
      model: options.model,
      dryRun: options.dryRun,
      verbose: options.verbose
    });
    if (options.dryRun) {
      console.log("\u{1F3C3}\u200D\u2642\uFE0F Dry run completed - skipping execution steps");
      return;
    }
    const project = options.project ?? prdPath.split("/").pop()?.replace(/\.[^/.]+$/, "").replace(/\W+/g, "-").toLowerCase();
    if (!project) {
      throw new Error("Could not derive project name");
    }
    console.log("\n\u{1F680} Step 2: Run Tasks");
    await runCmd({
      project,
      parallel: options.parallel,
      voting: options.voting,
      model: options.model,
      verbose: options.verbose
    });
    console.log("\n\u{1F50D} Step 3: Review");
    await reviewCmd({
      project,
      maxIter: options.maxIter,
      verbose: options.verbose
    });
    console.log("\n\u{1F517} Step 4: Aggregate");
    await aggregateCmd({
      project,
      verbose: options.verbose
    });
    console.log("\n\u{1F389} Complete pipeline finished successfully!");
  } catch (error45) {
    console.error("\u274C Pipeline failed:", error45);
    process.exit(1);
  }
}

